import { createDrawerNavigator } from "@react-navigation/drawer";
import { NavigationContainer } from "@react-navigation/native";
import { Button, View } from "react-native";
import MessageScreen from './MessageScreen.js';
import WeatherScreen from './WeatherScreen.js';
import MoodScreen from './MoodScreen.js';

function HomeScreen({ navigation }) {
  return (
    <View style={styles.homeContainer}>
      <TouchableOpacity style={styles.homeButton} onPress={navigation.openDrawer}>
        <Text style={styles.homeButtonText}>Open navigation drawer</Text>
      </TouchableOpacity>
      <TouchableOpacity style={styles.homeButton} onPress={() => navigation.navigate('Message to Fife Rabbits')}>
        <Text style={styles.homeButtonText}>Go to Message to Fife Rabbits</Text>
      </TouchableOpacity>
      <TouchableOpacity style={styles.homeButton} onPress={() => navigation.navigate('Environment')}>
        <Text style={styles.homeButtonText}>Go to check the Fife environment</Text>
      </TouchableOpacity>
      <TouchableOpacity style={styles.homeButton} onPress={() => navigation.navigate('Mood Color')}>
        <Text style={styles.homeButtonText}>Go to send you color of moods</Text>
      </TouchableOpacity>
    </View>
  );
}

const Drawer = createDrawerNavigator();

function App() {
  return (
    <NavigationContainer>
      <Drawer.Navigator initialRouteName="Home">
        <Drawer.Screen name="Home" component={HomeScreen} />
        <Drawer.Screen name="MessageScreen" component={MessageScreen} />
        <Drawer.Screen name="WeatherScreen" component={WeatherScreen} />
        <Drawer.Screen name="MoodScreen" component={MoodScreen} />
      </Drawer.Navigator>
    </NavigationContainer>
  );
}

export default App;
